import React from "react";

function MyComponent({ state, setState }) {
  function handleClick(e) {
    e.preventDefault()
    setState('Hello My Component')
    setState()
  }

  return (
    <>
      <h4>{process.env.REACT_APP_API_URL}</h4>
      <p onClick={handleClick}>{state}</p>
    </>
  );
}

export default MyComponent;
